/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<tr	class="ui5-table-row-root"	tabindex="${ifDefined(context._tabIndex)}"	@focusin="${context._onfocusin}"	@ui5-_cellclick="${ifDefined(context._oncellclick)}"	data-sap-focus-ref>	${ context.shouldPopin ? block1(context) : block3(context) }</tr>	${ context.shouldPopin ? block5(context) : undefined }`; };
const block1 = (context) => { return html`${ repeat(context.visibleCells, (item, index) => item._id || index, (item, index) => block2(item, index, context)) }`; };
const block2 = (item, index, context) => { return html`<slot name="${ifDefined(item._individualSlot)}"></slot>		`; };
const block3 = (context) => { return html`${ repeat(context.cells, (item, index) => item._id || index, (item, index) => block4(item, index, context)) }`; };
const block4 = (item, index, context) => { return html`<slot name="${ifDefined(item._individualSlot)}"></slot>		`; };
const block5 = (context) => { return html`${ repeat(context.popinCells, (item, index) => item._id || index, (item, index) => block6(item, index, context)) }`; };
const block6 = (item, index, context) => { return html`<tr class="ui5-table-popin-row" @ui5-_cellclick="${ifDefined(item._oncellclick)}"><td colspan="${ifDefined(context.visibleCellsCount)}"><span class="ui5-table-row-popin-title">${ifDefined(item.popinText)}:</span><div><slot name="${ifDefined(item.cell._individualSlot)}"></slot></div></td></tr>	`; };

export default block0;
